'From Squeak 2.0 BETA of May 8, 1998 on 20 May 1998 at 3:08:24 am'!!ChangeSet methodsFor: 'fileIn/Out' stamp: 'sw 5/20/1998 02:59'!fileOutPSFor: class on: stream 	"Write out removals and initialization for this class."	(methodChanges at: class name ifAbsent: [^ self]) associationsDo: [:mAssoc | 		(#(remove addedThenRemoved) includes: mAssoc value)			ifTrue:				[stream nextChunkPut: class name,					' removeSelector: ', mAssoc key storeString; cr]			ifFalse:				[(mAssoc key = #initialize and: [class isMeta]) ifTrue:					[stream nextChunkPut: class soleInstance name, ' initialize'; cr]]]! !